import React, { useState } from 'react';

// import { Container } from './styles';

export default function Manu() {
    const [openMenu, setOpenMenu] = useState(false);

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <a className="navbar-brand" href="#">Navbar</a>
        <button className="navbar-toggler" type="button" onClick={ ()=> setOpenMenu(state => !state) } data-toggle="collapse" data-target="#conteudoNavbarSuportado" aria-controls="conteudoNavbarSuportado" aria-expanded="false" aria-label="Alterna navegação">
            <span className="navbar-toggler-icon"></span>
        </button>

        <div className={`collapse navbar-collapse ${openMenu ? 'show' : ''}`} id="conteudoNavbarSuportado">
            <ul className="navbar-nav mr-auto">
            <li className="nav-item active">
                <a className="nav-link" href="#">Home <span className="sr-only">(página atual)</span></a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#">Link</a>
            </li>            
            <li className="nav-item">
                <a className="nav-link disabled" href="#">Desativado</a>
            </li>
            </ul>
        </div>
    </nav>
  );
}
